#include <vector>
#include <iostream>
using namespace std;

class Solution {

  private:
    bool isValid(const vector<int> &sub_nums) {
        bool result = true;
        for (auto it = sub_nums.cbegin(); it != sub_nums.cend(); ++it) {
            if (it != sub_nums.cend() - 1) {
                if (*it == *(it + 1)) {
                    result = false;
                    break;
                }
            }
        }
        return result;
    }

  public:
    long long countAlternatingSubarrays(vector<int> &nums) {
        long long result{0};
        for (auto it = nums.cbegin(); it != nums.cend(); ++it) {
            for (auto end = it + 1; end != nums.cend(); ++end) {
                if (isValid(vector<int>(it, end))) {
                    result++;
                }
            }
            if (isValid(vector<int>(it, nums.cend()))) {
                result++;
            }
        }
        return result;
    }
};

